import React from "react";
import '../navbar/navbar.css'

class Navbar extends React.Component{
    render(){
        return(
            <div>
                <nav>
                    <ul>
                        <li>Home</li>
                        <li>Login</li>
                    </ul>
                </nav>
            </div>
        )
    }
}

export default Navbar
